                    },
                    "trigger": {
                        "custom": "function(event)    \n    if event == \"PLAYER_REGEN_ENABLED\" then return end\n    \n    aura_env.lastSear = aura_env.lastSear or GetTime()\n    \n    -- check if specced into Clarity of Power\n    _, _, _, aura_env.cop = GetTalentInfo(7, 1, GetActiveSpecGroup())\n    \n    \n    -- create new tables for a fresh and clean start\n    aura_env.mobs = {}\n    aura_env.swp = {}\n    aura_env.vt = {}\n    aura_env.mf = {}\n    \n    \n    -- Repudiation of War\n    if not aura_env.RepudiationOfWarString then return true end\n    local trinket1, _, _, ilvl1 = GetItemInfo(GetInventoryItemLink(\"player\", 13) or \"\")\n    local trinket2, _, _, ilvl2 = GetItemInfo(GetInventoryItemLink(\"player\", 14) or \"\")\n    local rowIlvl = 0\n    \n    if trinket1 == aura_env.RepudiationOfWarString then\n        rowIlvl = ilvl1\n    elseif trinket2 == aura_env.RepudiationOfWarString then\n        rowIlvl = ilvl2\n    end\n    \n    if rowIlvl == 95 then  -- BC Timewalking\n        aura_env.row = 0.052\n    elseif rowIlvl == 160 then  -- WotLK Timewalking\n        aura_env.row = 0.0624\n    else\n        aura_env.row = 0.000121*math.exp(0.009308 * rowIlvl)\n    end\n    \n    return true\nend",
                        "custom_hide": "custom",
                        "events": "PLAYER_REGEN_DISABLED,PLAYER_REGEN_ENABLED",
                        "event": "Health",
                        "subeventPrefix": "SPELL",
                        "subeventSuffix": "_CAST_START",
                        "custom_type": "event",
                        "type": "custom"
                    }
                },
                {
                    "untrigger": [],
                    "trigger": {
                        "custom": "function()\n    -- Get localized strings\n    aura_env.RepudiationOfWarString = GetItemInfo(124519)\n    aura_env.InsanityBuffString = GetSpellInfo(132573)\n    aura_env.InsanityString = GetSpellInfo(129197)\n    aura_env.MentalFatigueString = GetSpellInfo(185104)\n    aura_env.SearingInsanityString = GetSpellInfo(179338)\n    aura_env.SurgeOfDarknessString = GetSpellInfo(87160)    \n    return true\nend",
                        "subeventPrefix": "SPELL",
                        "custom_hide": "custom",
                        "event": "Health",
                        "type": "custom",
