            "animation": {
                "main": {
                    "scalex": 1,
                    "x": 0,
                    "duration": "0.1",
                    "y": 0,
                    "rotate": 0,
                    "scaley": 1,
                    "colorFunc": "return -- created by Lleaf-Eredar(EU)\n\nfunction()\n    -- calculate total amount of mobs hit, also including buffs to Sear\n    if not aura_env.multiplier then\n        if not aura_env.mobs then return 1, 1, 1, 1 end\n        aura_env.multiplier = 0\n        for GUID, _ in pairs(aura_env.mobs) do\n            local mobMultiplier = 1\n            if aura_env.cop and not aura_env.swp[GUID] and not aura_env.vt[GUID] then\n                mobMultiplier = 1.4\n            end\n            if aura_env.mf[GUID] then\n                mobMultiplier = mobMultiplier * (1 + aura_env.row * aura_env.mf[GUID])\n            end\n            aura_env.multiplier = aura_env.multiplier + mobMultiplier\n        end\n    end\n    if aura_env.multiplier == 0 then return 1, 1, 1, 1 end\n    \n    -- get buffs, debuffs, channels, stats...\n    local haste = 1 + GetHaste() / 100\n    local mastery = 1 + GetMasteryEffect() / 100\n    local gcd = math.max(1, 1.5/haste)\n    local channel, _ = UnitChannelInfo(\"player\")\n    local insanity = UnitBuff(\"player\", aura_env.InsanityBuffString)\n    local _, _, _, mentalFatigue = UnitDebuff(\"target\", aura_env.MentalFatigueString)\n    \n    -- calculate Mind Sear DPET\n    local searTicks = (aura_env.lastSear and (GetTime() - aura_env.lastSear > 2/haste)) and 6 or 5\n    local mindsear = aura_env.multiplier * 0.25 * searTicks / math.max(1, 5/haste)  -- 25% SP per tick; 5s channel\n    if insanity or channel == aura_env.SearingInsanityString then\n        mindsear = 2 * mindsear\n    end\n    \n    -- calculate filler (Insanity/Mind Spike/SoD MS/Mind Flay) DPET\n    local filler = 0\n    if insanity or channel == aura_env.InsanityString then\n        filler = 3.168 / math.max(1, 3/haste)  -- (Insanity) 2 * Mind Flay; 3s channel\n    else\n        local sod, _, _, sodStacks, _, _, sodExpires = UnitBuff(\"player\", aura_env.SurgeOfDarknessString)\n        if aura_env.cop then\n            filler = 1.4  / gcd  -- (Mind Spike) 100% * 1.4; 1.5s cast\n            if sod and (sodStacks == 3 or sodExpires - GetTime() < 4.5/sodStacks) then\n                filler = filler * 1.5  -- 50% damage bonus from SoD\n            end\n        else\n            if sod and (sodStacks == 3 or sodExpires-GetTime() < 4.5/sodStacks) then\n                filler = 1.5 / gcd  -- (Mind Spike) 100% * 1.5; 1.5s GCD\n            else\n                filler = 1.584 / math.max(1, 3/haste)  -- (Mind Flay) 39.6% * 4 ticks; 3s channel\n            end\n        end\n    end\n    filler = filler * mastery\n    if mentalFatigue then filler = filler * (1 + aura_env.row * mentalFatigue) end\n    \n    -- calculate 3x Mind Blast + 1x Devouring Plague DPET\n    local mbdp = 1.65 * mastery  -- (Mind Blast) 3/4 * 220%\n    if mentalFatigue then mbdp = mbdp * (1 + aura_env.row * mentalFatigue) end\n    mbdp = mbdp + 1.452  -- (Devouring Plague) 1/4 * 580.8%\n    mbdp = mbdp / gcd\n    \n    -- debugging\n    --print(\"Mind Sear \"..mindsear..\"\\nFiller \"..filler..\"\\nMBDP \"..mbdp)\n    \n    -- choose color\n    if mindsear < filler then\n        return 1, 0, 0, 1  -- red\n    elseif mindsear < mbdp then\n        return 1, 1, 0, 1  -- yellow\n    else\n        return 0, 1, 0, 1  -- green\n    end\nend",
