                "custom": "-- created by Lleaf-Eredar(EU)\n\nfunction(_, timeStamp)\n    -- Untrigger if:\n    -- trigger is more than15s in the past OR\n    -- no more targets from last trigger alive\n    return timeStamp - (aura_env.timeStamp or 0) > 15 or aura_env.targets == 0\nend"
            },
            "trigger": {
                "custom": "-- created by Lleaf-Eredar(EU)\n\nfunction(_, timeStamp, event, _, sourceGUID, _, _, _, destGUID,_, _, _, ...)\n    \n    if sourceGUID == UnitGUID(\"player\")  then\n        \n        if event == \"SPELL_DAMAGE\" then\n            \n            local spellId, _, _, _, _, _, _, _, _, _, _, _, _, multistrike = ...\n            if multistrike then return end\n            \n            -- Mind Sear/Searing Insanity\n            if spellId == 49821 or spellId == 179337 then\n                local interval = timeStamp - (aura_env.timeStamp or 0)\n                aura_env.timeStamp = timeStamp\n                if interval > 0.1 then\n                    -- recycle table\n                    for k,_ in pairs(aura_env.mobs) do\n                        aura_env.mobs[k] = nil\n                    end\n                    aura_env.targets = 0\n                end \n                aura_env.mobs[destGUID] = true\n                aura_env.multiplier = nil\n                aura_env.targets = aura_env.targets + 1\n                return true\n            end\n            \n        end\n        \n        \n        -- put all mobs with DoTs from player into tables\n        if event == \"SPELL_AURA_APPLIED\" or event == \"SPELL_AURA_APPLIED_DOSE\" then\n            if ... == 589 then  -- SW:P\n                aura_env.swp[destGUID] = true\n                aura_env.multiplier = nil\n                \n            elseif ... == 34914 then  -- VT\n                aura_env.vt[destGUID] = true\n                aura_env.multiplier = nil\n                \n            elseif ... == 185104 then  -- Mental Fatigue\n                local _, _, _, _, amount = ...\n                aura_env.mf[destGUID] = amount or 1\n                aura_env.multiplier = nil\n                \n            elseif ... == 48045 or ... == 179338 then  -- Mind Sear/Searing Insanity\n                aura_env.lastSear = nil\n                aura_env.multiplier = nil\n                \n            end\n            return\n        end\n        \n        -- remove mobs from tables when no longer affected by DoTs\n        if event == \"SPELL_AURA_REMOVED\" then\n            if ... == 589 then\n                aura_env.swp[destGUID] = nil\n                aura_env.multiplier = nil\n                \n            elseif ... == 34914 then\n                aura_env.vt[destGUID] = nil\n                aura_env.multiplier = nil\n                \n            elseif ... == 185104 then\n                aura_env.mf[destGUID] = nil\n                aura_env.multiplier = nil\n                \n            elseif ... == 48045 or ... == 179338 then\n                aura_env.lastSear = GetTime()\n                \n            end\n            return\n        end\n        \n    end\n    \n    \n    -- target from Mind Sear table dies\n    if (event == \"UNIT_DIED\" or event == \"UNIT_DESTROYED\" or event == \"PARTY_KILL\" or event == \"SPELL_INSTAKILL\") and aura_env.mobs and aura_env.mobs[destGUID] then\n        aura_env.mobs[destGUID] = nil\n        aura_env.swp[destGUID] = nil\n        aura_env.vt[destGUID] = nil\n        aura_env.mf[destGUID] = nil\n        aura_env.multiplier = nil\n        aura_env.targets = aura_env.targets - 1\n        return        \n    end\n    \nend \n\n",
