            "customText": "-- Auspicious Spirits / Shadowy Apparition Tracker -- By Twintop - Illidan-US, 2016/07/22\nfunction()\n    local WA_RETURN = -1;\n    local totalSAs = 0;    \n    local LastTime = GetTime();\n    local CurrentTime = GetTime();\n    local color = \"FFFFFFFF\";\n    local insanityColor = \"FFFFFFFF\";\n    local currentInsanity = UnitPower(\"player\", SPELL_POWER_SHADOW_ORBS, forceUpdate);\n    local specGroup = GetActiveSpecGroup();\n    local isLotVSelected = select(4, GetTalentInfo(7, 1, specGroup));\n    local PIName = select(2, GetTalentInfo(6, 1, specGroup));\n    local isPIActive = select(11, UnitBuff(\"player\", PIName));\n    local S2MName = select(2, GetTalentInfo(7, 3, specGroup));\n    local isS2MActive = select(11, UnitBuff(\"player\", S2MName));\n    local _, _, _, vfCount, _, vfDuration, _, _, _, _, vfSpellId = UnitBuff(\"player\",\"Voidform\");\n    local PI_Mod = 1;\n    local S2M_Mod = 1;\n    local SA_Insanity = 4;\n    \n    local WA_RETURN_STRING;\n    WA_SA_NUM_UNITS = WA_SA_NUM_UNITS or 0;\n    \n    if WA_SA_NUM_UNITS > 0 then\n        for guid,count in pairs(WA_SA_STATS) do\n            totalSAs = totalSAs + WA_SA_STATS[guid].Count;\n            LastTime = WA_SA_STATS[guid].LastUpdate;\n        end\n        \n        if totalSAs > WA_SA_TOTAL then\n            WA_RETURN = WA_SA_TOTAL or 0;\n        else\n            WA_RETURN = totalSAs or 0;\n        end\n    else\n        WA_RETURN = -2;\n    end\n    \n    if WA_RETURN <= 0 then\n        return \"0\";\n    end\n    \n    if isPIActive then\n        PI_Mod = 1.25;\n    end\n    \n    if isS2MActive then\n        S2M_Mod = 3;\n    end\n    \n    local totalInsanity = WA_RETURN*SA_Insanity*PI_Mod*S2M_Mod;\n    \n    if not (vfSpellId == nil) then --In Voidform, don't care about overflow. Green light!\n        insanityColor = \"FF00FF00\";\n    elseif (currentInsanity + totalInsanity) >= 100 then --Hard overflow of Insanity. Red light!\n        insanityColor = \"FFFF0000\";\n    elseif (isLotVSelected and currentInsanity >= 70)  then --We can active Voidform but aren't overflowing yet. Yellow light!\n        insanityColor = \"FFFFFF00\";\n    else\n        insanityColor = \"FFFFFFFF\";\n    end\n    \n    WA_RETURN_STRING = string.format(\"|c%s%s|r\\n|c%s+%d|r\", color, WA_RETURN, insanityColor, totalInsanity);\n    return WA_RETURN_STRING;\nend\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n",
