            "frameStrata": 5,
            "xOffset": 320,
            "customText": "-- Mind Spike Detonation Tracker -- By Twintop - Stormrage-US, 2016/04/23\nfunction()\n    local latency = 0.1; --Latency to account for with color switches\n    local timerColor = \"FFFFFFFF\";    -- Color of timer. Yellow if >= GCD*3 + latency (above last chance refresh window), Red if >= GCD + latency (enough time to know this is your refresh window), Grey if < GCD + latency (no way to refresh in time :'( )\n    local stackColor  = \"FFFFFFFF\";    -- Color of current stack. White if <= 9, Green if == 10\n    \n    local gcd = 1.5/(1+UnitSpellHaste(\"player\")/100);\n    local spellName = GetSpellInfo(73510);\n    local _, _, _, buffCount, _, buffDuration, buffExp = UnitDebuff(\"target\", spellName);\n    \n    if buffExp == nil then\n        return\n    end\n    \n    local buffRemains = buffExp - GetTime();\n    \n    \n    if buffCount == 10 then\n        stackColor = \"FF00FF00\";   \n    end\n    \n    if buffRemains >= 6 then\n        timerColor = \"FFFFFFFF\";\n    elseif buffRemains >= (gcd*3 + latency) then\n        timerColor = \"FFFFFF00\";\n    elseif buffRemains >= (gcd*1 + latency) then\n        timerColor = \"FFFF0000\";\n    else\n        timerColor = \"FF666666\";\n    end\n    \n    \n    return string.format(\"|c%s%.1f|r\\n|c%s%d|r\", timerColor, buffRemains, stackColor, buffCount); \nend\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n",
