            "xOffset": 230,
            "customText": "-- Mental Fatigue / T18 Class Trinket Tracker -- By Twintop - Stormrage-US, 2015/06/07\nfunction()\n    local latency = 0.1; --Latency to account for with color switches\n    local timerColor = \"FFFFFFFF\";    -- Color of timer. White if >= GCD*2 + latency (above optimal refresh window), Red if >= GCD*1/2 + latency (enough time to know this is your refresh window), Grey if < GCD*1/2 + latency (1 MF tick, no way to refresh in time :'( )\n    local stackColor  = \"FFFFFFFF\";    -- Color of current stack. White if <= 4, Green if == 5\n    \n    local gcd = 1.5/(1+UnitSpellHaste(\"player\")/100);\n    local spellName = GetSpellInfo(185104);\n    local _, _, _, buffCount, _, buffDuration, buffExp = UnitDebuff(\"target\", spellName);\n    \n    if buffExp == nil then\n        return\n    end\n    \n    local buffRemains = buffExp - GetTime();\n    \n    \n    if buffCount == 5 then\n        stackColor = \"FF00FF00\";   \n    end\n    \n    if buffRemains >= 5 then\n        timerColor = \"FFFFFFFF\";\n    elseif buffRemains >= (gcd*2 + latency) then\n        timerColor = \"FFFFFF00\";\n    elseif buffRemains >= (gcd*1/2 + latency) then\n        timerColor = \"FFFF0000\";\n    else\n        timerColor = \"FF666666\";\n    end\n    \n    \n    return string.format(\"|c%s%.1f|r\\n|c%s%d|r\", timerColor, buffRemains, stackColor, buffCount); \nend\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n",
